import React from 'react';
import Navbar from './elements/Navbar';
import './App.css';
import Home from './elements/pages/Home';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Services from './elements/pages/Services';
import Places from './elements/pages/Places';
import SignUp from './elements/pages/SignUp';
import Contactus from './elements/pages/Contactus';
import Signin from './elements/pages/Signin';
function App() {

  return (
    <>
      <Router>
        <Navbar />
        <Routes>
          <Route path='/' exact element={Home} />
          <Route path='/services' element={Services} />
          <Route path='/places' element={Places} />
          <Route path='/contactus'  element={Contactus} />
          <Route path='/sign-up' element={SignUp} />
          <Route path='/signin' element={Signin} />
        </Routes>
      </Router>
    </>
  );
}

export default App;
